import React from 'react'
import Navbar from './Navbar'
import Articles from './Articles'


const linksArray = ["Option1", "Option2", "Option3", "Option4"];

const Home = () => {
  return (
    <div>
        <Navbar links={linksArray}/>
        <Articles/>
    </div>
  )
}

export default Home
